import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-cars',
  templateUrl: './cars.component.html',
  styleUrls: ['./cars.component.css']
})
export class CarsComponent implements OnInit {

  name: string | undefined;
  speed: number | undefined;
  model: string | undefined;
  colors: Colors | any;
  options: string[] | any;


  constructor() { }


  ngOnInit() {
    this.name = 'BMW';
    this.speed = 250;
    this.model = 'X5';
    this.colors = {
      car: 'Белый',
      salon: 'Бежевый',
      wheels: 'Серебристые'
    };
    this.options = ['ABS', 'ASR', 'ESP', 'AutoParking'];
  }

  carSelect(carName: any) {
    if (carName == 'bmw') {
      this.name = 'BMW';
      this.speed = 250;
      this.model = 'X5';
      this.colors = {
        car: 'Белый',
        salon: 'Бежевый',
        wheels: 'Серебристые'
      };
      this.options = ['ABS', 'ASR', 'ESP', 'AutoParking'];
    } else if (carName =='audi') {
      this.name = 'Audi';
      this.speed = 280;
      this.model = 'RS8';
      this.colors = {
        car: 'Синий',
        salon: 'Бежевый',
        wheels: 'Черный'
      };
      this.options = ['ABS', 'ESP', 'AutoParking'];
    } else {
      this.name = 'Volkswagen';
      this.speed = 275;
      this.model = 'Golf GTI';
      this.colors = {
        car: 'Красный',
        salon: 'Черный',
        wheels: 'Черный'
      };
      this.options = ['ABS', 'ESP', 'ESR', 'AutoParking'];
    }
  }
}

interface Colors {
  car: string,
  salon: string,
  wheels: string
}
